import React, {useState} from "react";
import MenuBar from "../components/MenuBar";

function App() {
    const [data, setData] = useState({});
    fetch('/api/test')
    .then(res => res.json())
    .then(data => setData(data), () => {
        console.log('data read: ', data);
    })

    return (
        <div className="App">
            <MenuBar></MenuBar>
            {data.addr}
        </div>
    );
}

export default App;
